import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import '../styles/ContactoPage.css';

const ContactoPage = () => {
    return (
        <div className="contacto-page">
            <h1>Contacto</h1>
            <ul className="contacto-info">
                <li>
                    <FontAwesomeIcon icon={faEnvelope} /> 
                    Correo electrónico: <a href="mailto:hola@eneacoaching.es">hola@eneacoaching.es</a>
                </li>
                <li>
                    <FontAwesomeIcon icon={faPhone} /> 
                    Teléfono: <a href="tel:+34623148391">+34 623 14 83 91</a>
                </li>
            </ul>
            
            <form className="contacto-form">
                <label htmlFor="name">Nombre:</label>
                <input type="text" id="name" placeholder="Tu nombre" />

                <label htmlFor="email">Correo electrónico:</label>
                <input type="email" id="email" placeholder="Tu correo" />

                <label htmlFor="message">Mensaje:</label>
                <textarea id="message" placeholder="Escribe tu mensaje"></textarea>

                <button type="submit">Enviar</button>
            </form>
        </div>
    );
};

export default ContactoPage;
